import './PostReviewPage.css';
import * as React from "react";
import Rating from '@mui/material/Rating';

export default function ReviewRatings() {
    const [ratingValues, setRatingValues] = React.useState([0,0,0]);
    return (
        <div className='review-ratings'>
            <h2>Ratings</h2>
            <h4>Security</h4>
            <Rating name="half-rating" precision={0.1} size='large' 
             onChange={(e, newValue) => {
                setRatingValues([newValue, ratingValues[1], ratingValues[2]]);
             }} />
        </div>
    )
}
